import React, { useState } from 'react';
import styles from './WorkTeamManagement.module.css'; // 假设有相应的CSS模块

const WorkTeamManagement = () => {
    // 模拟从服务器获取的员工数据
    const teamMembers = [
        { name: "Charles John", email: "charles.j@gmail.com", phone: "123-456-7890", startDate: "11/12/2023", tenure: "2 years", position: "UX Researcher" },
        { name: "Dianne Russell", email: "dianne@gmail.com", phone: "987-654-3210", startDate: "10/08/2022", tenure: "1 year", position: "UX Designer" },
        // 可以添加更多员工数据
    ];

    const [visible, setVisible] = useState(false);
    const [currentMember, setCurrentMember] = useState({});

    const viewTeamMember = () => {
        setVisible(true);
        setCurrentMember(teamMembers[0]); // 假定我们显示第一个员工的信息
    };

    return (
        <div className={styles.container}>
            <h1>NYC Work Team Management</h1>
            <div className={styles.feature}>
                <button className={styles.actionButton} onClick={viewTeamMember}>View team member</button>
                <p>Users can view team members</p>
                {visible && (
                    <div className={styles.memberDetails}>
                        <p>Name: {currentMember.name}</p>
                        <p>Email: {currentMember.email}</p>
                        <p>Phone: {currentMember.phone}</p>
                        <p>Start Date: {currentMember.startDate}</p>
                        <p>Tenure: {currentMember.tenure}</p>
                        <p>Position: {currentMember.position}</p>
                    </div>
                )}
            </div>
            <div className={styles.feature}>
                <button className={styles.actionButton}>Edit team member</button>
                <p>Users can edit team members</p>
            </div>
            <div className={styles.feature}>
                <button className={styles.actionButton}>Create team member</button>
                <p>Users can create team members</p>
            </div>
            <div className={styles.feature}>
                <button className={styles.actionButton}>Delete team member</button>
                <p>Users can delete team members</p>
            </div>
            <div className={styles.feature}>
                <button className={styles.actionButton}>Import/Export CSV</button>
                <p>Users can export a CSV list of team members</p>
            </div>
            <button className={styles.addButton}>+</button>
        </div>
    );
};

export default WorkTeamManagement;
